import React, { Component } from 'react';
import { Toolbar, Typography } from '@material-ui/core';

class BarSesion extends Component {
    render() {
        return (
        
                <Toolbar>
                    <Typography variant="h5"> SchoolDevelopers</Typography>
                </Toolbar>
        );
    }
}

export default BarSesion;
